pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;

contract Tokens {

  // global variables
  address supervisor;

  struct Capability{
    bool isValid;
    address   vidO;
    string[]  op;
    string[]  context;
  }

  struct DelegationTree{
    address     vidP;
    address[]   vidC;
    uint        depth;
    string[]    dar;
  }

  struct Tree{
    uint        maxDepth;
    mapping(address => DelegationTree)  IDC;
  }

  mapping(address => Capability)  Icap;
  mapping(address => Tree)        IDT;

  constructor() public {
    supervisor = msg.sender;
  }

  function generateIcap(string[] memory _op) public{
    require(
      msg.sender == supervisor,
      'aaaaaaaaaaaaa'
    );
    Icap[msg.sender].op = _op;
  }

}
